import React, {Component} from "react";

class MemeGenerator extends Component {
    constructor() {
        super()
        this.state = {
            topText: "",
            bottomText: "",
            randomImg: "https://www.shutterstock.com/image-photo/red-fox-vulpes-bushy-tail-260nw-625736129.jpg"
        }

    }
    componentDidMount() {
        fetch("https://api.imgflip.com/get_memes")
            .then(response => response.json())
            .then(response => {
                const {memes} = response.data
                console.log()
                this.setState({allMemeImags: memes})
            })
    }
    render() {
        return (
            <h1>MEME GENERATOR SECTION</h1>
        )
    }
}
export default MemeGenerator
